  const buttonStyle = "bg-indigo-500 hover:bg-blue-500 active:bg-cyan-500 mt-2 rounded-xl shadow-lg shadow-cyan-500/50";
  return (
    <div>
      <h1>Bookkeeper</h1>
      <nav
        style={{
          borderBottom: "solid 1px",
          paddingBottom: "1rem"
        }}
      >
        <Link to="/training">Training</Link> |{" "}
        <Link to="/history">History</Link>
      </nav>
    </div>
  );
};

export default Navbar;
